  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Kodiak
  NWR outlines Refuge accomplishments during the 1989 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses the master plan,
  management planning, public participation, and research and investigations. Refuge
  administration is outlined; information about personnel, volunteer programs, funding,
  safety, and technical assistance is given. Habitat management is also covered; subjects
  include fire management and wilderness areas. The wildlife section of the report
  discusses waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals,
  marine mammals, fisheries resources, and marking and bird banding. The public uses
  of the Refuge described in this report include outdoor classrooms, interpretive
  programs, hunting, fishing, trapping, and law enforcement. The equipment and facilities
  section of the report provides information about rehabilitation, equipment replacement,
  and computer systems. Cooperative programs, economic uses of the Refuge, and items
  of interest are provided at the end. Refuge brochures are attached.\",\n\t\"owner_org\":
